    hash = hash::Sha1().calculate("abcdefghijk"); GTEST_ASSERT_EQ(hash->to_string(), "5dfac39f71ad4d35a153ba4fc12d943a0e178e6a"); delete hash;
    hash = hash::Sha1().calculate("abcdefghijkl"); GTEST_ASSERT_EQ(hash->to_string(), "eb4608cebfcfd4df81410cbd06507ea6af978d9c"); delete hash;
